export default (function(a,b,c,d,e,f,g,h){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:e,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:a,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:a,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:a,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:e,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}},{id:2784,attributes:{type:a,item_lang:{data:{id:3451,attributes:{title:"Renfield",slug:"renfield"}}}}},{id:2788,attributes:{type:a,item_lang:{data:{id:3455,attributes:{title:"The Killer",slug:"the-killer"}}}}},{id:2790,attributes:{type:a,item_lang:{data:{id:3457,attributes:{title:"The Color Purple",slug:"the-color-purple"}}}}},{id:2798,attributes:{type:e,item_lang:{data:{id:3465,attributes:{title:"Silo",slug:"silo"}}}}},{id:2802,attributes:{type:e,item_lang:{data:{id:3469,attributes:{title:"The Night Agent",slug:"the-night-agent"}}}}}],meta:{pagination:{page:g,pageSize:25,pageCount:g,total:10}}},qJr2cQ6nCw:{data:{id:2756,attributes:{imdbId:"tt13456318",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BNjk4ZDM2NjktMjA2Ni00YThjLTlhYjYtOTY2OTUwYTQxMWI2XkEyXkFqcGdeQXVyMTEzMTI1Mjk3._V1_SX300.jpg",type:a,ratings:[],item_lang:{data:{id:3423,attributes:{title:d,plot:"Living with her snobby family on the brink of bankruptcy, Anne Elliot is an unconforming woman with modern sensibilities. When Fredrick Wentworth the dashing one she once sent away crashes back into her life, Anne must choose between putting the past behind her or listening to her heart when it comes to second chances.",slug:"persuasion"}}},books:{data:[{id:13113,attributes:{title:d,description:"Anne est la seconde fille de l'honorable Sir Elliot de Kellynch. Persuadée par son amie Lady Russel, elle a dû rompre ses fiançailles avec le jeune Frederick Wentworth, un officier de marine pauvre, car il ne présentait pas les assurances d'un bon parti. Huit ans plus tard, sa famille connaît des revers de fortune. Son père décide alors de louer le château familial à l'amiral Croft, qui se trouve être le beau-frère de Frederick. Anne appréhende de revoir celui qui est resté son grand amour. Alors que s'achève la guerre avec la France, le capitaine Wentworth, fortune faite, revient avec le désir de se marier pour fonder un foyer. Il a conservé du refus d'Anne la conviction que la jeune fille manquait de caractère et se laissait trop aisément persuader...Dernier roman complet de Jane Austen, achevé en août 1816, un an avant sa mort, Persuasion offre la satire d'une société engoncée dans ses principes, ainsi qu'une galerie de personnages croqués sans aménité : un père futile qui ne pense qu'à son apparence, un soeur cadette égoïste et hypocondriaque, un cousin arriviste, une veuve manipulatrice... Comme dans Northanger Abbey, la vie mondaine et superficielle de Bath sert d'arrière-plan.Publié à titre posthume en 1818, Persuasion est aussi le seul roman de Jane Austen écrit pendant la période où l'action se situe : il est entrepris le 8 août 1815, le jour même où la population britannique apprend l'exil de Napoléon à l'île d'Elbe. En toile de fond, on trouve donc la défaite, l'abdication et l'exil de l'Empereur.",thumbnail:b,authors:[c],firstBook:true,published:"2011-01-01",publisher:b,subtitle:b}},{id:13114,attributes:{title:d,description:h,thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=HqarHkNnwqcC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[c],firstBook:f,published:"1993-01-01",publisher:"Wordsworth Editions",subtitle:b}},{id:13115,attributes:{title:d,description:"Persuasion By Jane Austen Persuasion is the last novel fully completed by Jane Austen. It was published at the end of 1817, six months after her death. The story begins seven years after the broken engagement of Anne Elliot to then Commander Frederick Wentworth. Anne Elliot, then 19 years old, fell in love and accepted a proposal of marriage from the handsome young naval officer. He was clever, confident, ambitious, and employed, but not yet wealthy and with no particular family connections to recommend him. Her father Sir Walter and her older sister Elizabeth maintained that he was no match for an Elliot of Kellynch Hall, the family estate. Lady Russell, acting in place of Anne's late mother, persuaded her to break the engagement, which she saw as imprudent for one so young. They are the only ones who know about this short engagement, as younger sister Mary was away at school. The Elliot family is now in financial trouble. Kellynch Hall will be let, and the family will settle in Bath until finances improve. The Baronet Sir Walter, the socially-conscious father and daughter Elizabeth and her new companion Mrs. Clay look forward to the move. Anne is less sure she will enjoy Bath. Mary is married to Charles Musgrove of nearby Uppercross Hall, the heir to a respected local squire. Anne visits Mary and her family, where she is well-loved. The end of the war puts sailors back on shore, including the tenants of Kellynch Hall, Admiral Croft and his wife Sophia, who is the sister of Frederick Wentworth, now a wealthy naval captain. Frederick visits his sister and meets the Uppercross family, including Anne.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=i7gpswEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[c],firstBook:f,published:"2017-11-09",publisher:"Createspace Independent Publishing Platform",subtitle:c}},{id:13116,attributes:{title:"Persuasion (勸服)",description:"Eight years ago Anne Elliot bowed to pressure from her family and made the decision not to marry the man she loved, Captain Wentworth. Now, circumstances have conspired to bring him back into her social circle and Anne finds her old feelings for him reignited. However, when they meet again Wentworth behaves as if they are strangers and seems more interested in her friend Louisa. In this, her final novel, Jane Austen tells the story of a love that endures the tests of time and society with humour, insight and tenderness.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=6MoaAwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[c],firstBook:f,published:"2011-07-15",publisher:"Hyweb Technology Co. Ltd.",subtitle:b}},{id:13117,attributes:{title:d,description:h,thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=YACCAwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[c,"James Kinsley","Deidre Lynch"],firstBook:f,published:"2008-04-17",publisher:"Oxford University Press",subtitle:b}}]}}},meta:{}}},prerenderedAt:1688531235571}}("movie","","Jane Austen","Persuasion","series",false,1,"The romance between Captain Wentworth and Anne, the daughter of Sir Walter Elliot, seems doomed because of the young man's family connections and lack of wealth."))